import React, { useState } from 'react';
import axios from 'axios';
import './App.css'; // Import your CSS file

function App() {
  const [message, setMessage] = useState('');
  const [response,setResponse] = useState('');

  const handleSubmit = async (event) => {
    event.preventDefault();
    const res = await axios.post('http://localhost:5000/chat', { message });
    setResponse(res.data);
  };

  return (
    <div className="app">
      <h1>Welcome to Salary Predictor</h1>
      <p>Salary Predictor is an AI-powered tool designed to demonstrate the power of AI, tools and better map the future montetary prospects of college students. </p>
      <p>Enter your attributes below to get started! (Ex: "Computer Science Major, Asian, 6 Feet, CMU")</p>

      <form onSubmit={handleSubmit} className="form">
        <input
          type="text"
          value={message}
          onChange={(e) => setMessage(e.target.value)}
          placeholder="Enter attributes, separated by commas"
          className="input"
        />
        <button type="submit" className="button">Send</button>
      </form>

      {response && <div className="response"><p>{response}</p></div>}
    </div>
  );

}
<div class="bar-chart">
<div class="bar" style="height: 9.3%;"><span>Under $15,000</span></div>
<div class="bar" style="height: 8.1%;"><span>$15,000 to $24,999</span></div>
<div class="bar" style="height: 7.8%;"><span>$25,000 to $34,999</span></div>
</div>

export default App;
